import React from 'react';
import {
  Container,
  Logo,
  NavContainer,
  NavLink,
  NavItemText,
  NavLogInText,
  NavSignUp,
  NavSignUpText,
} from './styles';

const HomeHeader: React.FC = () => {
  return (
    <Container>
      <NavContainer>
        <Logo>Supply Me</Logo>
        <NavMenu>
          <NavLink to="">
            <NavItemText>How it works?</NavItemText>
          </NavLink>
          <NavLink to="">
            <NavLogInText>Log In</NavLogInText>
          </NavLink>
          <NavLink to="">
            <NavSignUp>
              <NavSignUpText>Become a Partner</NavSignUpText>
            </NavSignUp>
          </NavLink>
        </NavMenu>
      </NavContainer>
    </Container>
  );
};

export default HomeHeader;
